xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	4.&amp;nbsp;&lt;span&gt;请简要介绍进程和程序的关系以及如何管理进程。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:18.0000pt;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;','2304Linux系统管理-考试',0,0,'jx23040009','2023-07-29 15:40:21','2023-07-30 16:16:57'),(11,'2304Linux系统管理-考试','&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18.0000pt;text-align:center;&quot;&gt;&#xa;	&lt;b&gt;&lt;span&gt;觉行学校&lt;/span&gt;&lt;span&gt;2304&lt;/span&gt;&lt;span&gt;班&lt;/span&gt;&lt;span&gt;Linux&lt;/span&gt;&lt;span&gt;系统管理试题&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;/b&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18.0000pt;text-align:center;&quot;&gt;&#xa;	&lt;span&gt;2023&lt;/span&gt;&lt;span&gt;年&lt;/span&gt;&lt;span&gt;7&lt;/span&gt;&lt;span&gt;月&lt;/span&gt;&lt;span&gt;28&lt;/span&gt;&lt;span&gt;日&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:18.0000pt;&quot;&gt;&#xa;	&lt;span style=&quot;font-size:32px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color:#555555;font-family:fzzh, Helvetica, Arial, sans-serif;font-size:32px;background-color:#FFFFFF;&quot;&gt;毛晓磊：48 + 20 = 68&lt;/span&gt;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:18.0000pt;&quot;&gt;&#xa;	&lt;span&gt;一、填空题（每空&lt;/span&gt;&lt;span&gt;2&lt;/span&gt;&lt;span&gt;分，共&lt;/span&gt;&lt;span&gt;60&lt;/span&gt;&lt;span&gt;分）&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	1.&amp;nbsp;Linux&lt;span&gt;系统将用户的意愿转化为命令交给&lt;/span&gt;&lt;span&gt;__&lt;span style=&quot;color:#003399;&quot;&gt;_&lt;span style=&quot;color:#006600;&quot;&gt;shell&lt;/span&gt;_&lt;/span&gt;__&lt;/span&gt;&lt;span&gt;，&lt;/span&gt;&lt;span&gt;shell&lt;/span&gt;&lt;span&gt;根据命令在&lt;/span&gt;&lt;span&gt;__&lt;span style=&quot;color:#006600;&quot;&gt;内核&lt;/span&gt;____&lt;/span&gt;&lt;span&gt;中创建进程操作输入输出设备。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	2.&amp;nbsp;Linux&lt;span&gt;目录结构中，&lt;/span&gt;&lt;span&gt;/etc&lt;/span&gt;&lt;span&gt;目录用于存放&lt;/span&gt;&lt;span&gt;__配置文件______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	3.&amp;nbsp;Vim&lt;span&gt;编辑器有三种模式，分别是命令模式、插入模式和&lt;/span&gt;&lt;span&gt;&lt;span style=&quot;background-color:#E53333;&quot;&gt;__编辑&lt;/span&gt;____&lt;/span&gt;&lt;span&gt;模式。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	4.&amp;nbsp;&lt;span&gt;用户管理包括用户和用户组信息的维护，每个用户只能属于一个主组，但可以加入多个辅助组。这些信息存储在&lt;/span&gt;/etc/__passwd____&lt;span&gt;文件中。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	5.&amp;nbsp;&lt;span&gt;文件的三组权限包括所有者权限、用户组权限和其他用户权限，分别用&lt;/span&gt;r&lt;span&gt;、&lt;/span&gt;&lt;span&gt;w&lt;/span&gt;&lt;span&gt;、&lt;/span&gt;&lt;span&gt;x&lt;/span&gt;&lt;span&gt;表示。更改权限的两种方法分别是数字表示法和&lt;/span&gt;&lt;span&gt;_字母_____&lt;/span&gt;&lt;span&gt;表示法。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	6.&amp;nbsp;&lt;span&gt;进程是程序执行的实例，具有&lt;/span&gt;PID&lt;span&gt;以及与之相关联的其他信息。通过&lt;/span&gt;&lt;span&gt;__fork____&lt;/span&gt;&lt;span&gt;命令可以创建新任务，通过&lt;/span&gt;&lt;span&gt;__top____&lt;/span&gt;&lt;span&gt;命令可以查看系统资源消耗。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	7.&amp;nbsp;Linux&lt;span&gt;系统中，用于创建目录的命令是&lt;/span&gt;&lt;span&gt;___mkdir___&lt;/span&gt;&lt;span&gt;，用于删除目录的命令是&lt;/span&gt;&lt;span&gt;__rm____&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	8.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，文件的大小单位是&lt;/span&gt;&lt;span&gt;___字节___&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	9.&amp;nbsp;&lt;span&gt;查看当前工作目录的命令是&lt;/span&gt;__pwd____&lt;span&gt;，切换工作目录的命令是&lt;/span&gt;&lt;span&gt;_cd_____&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	10.&amp;nbsp;&lt;span&gt;压缩文件的常用命令有&lt;/span&gt;tar&lt;span&gt;和&lt;/span&gt;&lt;span&gt;___zip___&lt;/span&gt;&lt;span&gt;，解压缩文件的常用命令有&lt;/span&gt;&lt;span&gt;unzip&lt;/span&gt;&lt;span&gt;和&lt;/span&gt;&lt;span&gt;_&lt;span style=&quot;background-color:#E53333;&quot;&gt;untar___&lt;/span&gt;__&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	11.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于显示文本文件内容的命令是&lt;/span&gt;&lt;span&gt;__cat____&lt;/span&gt;&lt;span&gt;，用于在终端输出信息的命令是&lt;/span&gt;&lt;span&gt;__echo____&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	12.&amp;nbsp;&lt;span&gt;在文件名后加上&lt;/span&gt;___./___&lt;span&gt;表示执行该文件，而不是在终端中输入命令。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	13.&amp;nbsp;&lt;span&gt;执行一条长时间运行的命令时，可以使用&lt;/span&gt;&lt;span style=&quot;background-color:#E53333;&quot;&gt;_____&lt;/span&gt;_&lt;span&gt;符号将其放入后台运行。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	14.&amp;nbsp;&lt;span&gt;将一个命令的输出作为另一个命令的输入可以使用&lt;/span&gt;_|_____&lt;span&gt;符号。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	15.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于查询命令所在位置的命令是&lt;/span&gt;&lt;span&gt;____which_&lt;/span&gt;&lt;span&gt;，用于查询命令的帮助信息的命令是&lt;/span&gt;&lt;span&gt;_&lt;span style=&quot;background-color:#E53333;&quot;&gt;__help_&lt;/span&gt;__&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	16.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于列出文件和目录详细信息的命令是&lt;/span&gt;&lt;span&gt;__ls-al____&lt;/span&gt;&lt;span&gt;，用于只列出文件和目录名称的命令是&lt;/span&gt;&lt;span&gt;__ls____&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	17.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于查找文件的命令是&lt;/span&gt;&lt;span&gt;___find___&lt;/span&gt;&lt;span&gt;，用于查找指定字符串的命令是&lt;/span&gt;&lt;span&gt;_grep____&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	18.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于修改文件权限的命令是&lt;/span&gt;&lt;span&gt;__chmod___&lt;/span&gt;&lt;span&gt;，用于修改文件所有者的命令是&lt;/span&gt;&lt;span&gt;___chown___&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	19.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于显示当前系统时间的命令是&lt;/span&gt;&lt;span&gt;__date____&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	20.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于显示正在运行的进程信息的命令是&lt;/span&gt;&lt;span&gt;&lt;span style=&quot;background-color:#E53333;&quot;&gt;_pa___&lt;/span&gt;__&lt;/span&gt;&lt;span&gt;，用于杀死一个进程的命令是&lt;/span&gt;&lt;span&gt;__kill____&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	21.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于复制文件或目录的命令是&lt;/span&gt;&lt;span&gt;__cp____&lt;/span&gt;&lt;span&gt;，用于移动文件或目录的命令是&lt;/span&gt;&lt;span&gt;__mv____&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	22.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于打印文件内容到标准输出设备的命令是&lt;/span&gt;&lt;span&gt;__cat____&lt;/span&gt;&lt;span&gt;，用于将标准输入设备重定向到指定文件的命令是&lt;/span&gt;&lt;span&gt;_&amp;lt;_____&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	23.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于将文件或目录从本地复制到远程主机的命令是&lt;/span&gt;&lt;span&gt;__scp____&lt;/span&gt;&lt;span&gt;，用于从远程主机复制文件或目录到本地的命令是&lt;/span&gt;&lt;span&gt;___scp___&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	24.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于在文件中添加新内容的命令是&lt;/span&gt;&lt;span&gt;__echo____&lt;/span&gt;&lt;span&gt;，用于用指定字符串替换文件中的某个字符串的命令是&lt;/span&gt;&lt;span&gt;___sed___&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	25.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于挂载文件系统的命令是&lt;/span&gt;&lt;span&gt;____mount__&lt;/span&gt;&lt;span&gt;，用于卸载文件系统的命令是unmount&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	26.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于将多个文件合并成一个文件的命令是&lt;/span&gt;&lt;span&gt;_cat_____&lt;/span&gt;&lt;span&gt;，用于从文件中提取部分内容的命令是&lt;/span&gt;&lt;span&gt;__grep____&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	27.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于修改用户密码的命令是&lt;/span&gt;&lt;span&gt;__passwd____&lt;/span&gt;&lt;span&gt;，用于查看当前登录用户的身份信息的命令是&lt;/span&gt;&lt;span&gt;____cat/etc/psswd__&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	28.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于在文件中搜索指定字符串的命令是&lt;/span&gt;&lt;span&gt;_grep_____&lt;/span&gt;&lt;span&gt;，用于在多个文件中搜索指定字符串的命令是&lt;/span&gt;&lt;span&gt;___grep___&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	29.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于设置环境变量的命令是&lt;/span&gt;&lt;span&gt;_&lt;span style=&quot;background-color:#E53333;&quot;&gt;____&lt;/span&gt;_&lt;/span&gt;&lt;span&gt;，用于查看当前已经设置的环境变量的命令是&lt;/span&gt;&lt;span&gt;___env___&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	30.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于打包文件的命令是&lt;/span&gt;&lt;span&gt;__tar____&lt;/span&gt;&lt;span&gt;，用于解包文件的命令是&lt;/span&gt;&lt;span&gt;__tar____&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:18.0000pt;&quot;&gt;&#xa;	&lt;span&gt;二、简答题（每题&lt;/span&gt;&lt;span&gt;10&lt;/span&gt;&lt;span&gt;分，共&lt;/span&gt;&lt;span&gt;40&lt;/span&gt;&lt;span&gt;分）&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	1.&amp;nbsp;&lt;span&gt;请简要介绍&lt;/span&gt;Linux&lt;span&gt;系统的历史和特点。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	历史：Linux的历史可以追溯到1991年，由芬兰计算机科学家Linus Torvalds开发。他开始了一个简单的操作系统内核项目，最初只是为了在个人电脑上运行一些基本的任务。随着时间的推移，越来越多的开发者加入了这个项目，为其添加新功能、改进性能，并扩展了其应用范围。Linux的开源性质意味着其源代码对所有人开放，任何人都可以参与开发和贡献。&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	特点：&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;开源性：Linux是一种开源操作系统，这意味着其源代码对公众开放。任何人都可以查看、修改和分发Linux内核和软件，这也促进了开发者社区的形成。&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;多用户和多任务：Linux是一种真正的多用户操作系统，允许多个用户同时访问计算机并运行各自的任务。它也是多任务的，能够在后台同时运行多个进程。&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;强大的命令行界面：Linux提供了强大而灵活的命令行界面，称为Shell。通过Shell，用户可以直接与系统交互，并执行各种任务和操作，这为高级用户和系统管理员提供了更大的控制权和自定义能&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	2.&amp;nbsp;&lt;span&gt;请解释一下&lt;/span&gt;Linux&lt;span&gt;系统中文件权限的含义及如何修改文件权限。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;在Linux系统中，每个文件和目录都有三种不同的权限：所有者权限、群组权限和其他用户权限。每种权限可以用三个字符表示：读取权限（r）、写入权限（w）和执行权限（x）。这些权限控制了对文件或目录的不同操作。&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	3.&amp;nbsp;&lt;span&gt;请简要介绍&lt;/span&gt;Vim&lt;span&gt;编辑器。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;模式：Vim编辑器使用多个模式来区分不同的操作。最常用的模式是普通模式（Normal Mode）、插入模式（Insert Mode）和命令行模式（Command Line Mode）。普通模式用于导航和编辑文本，插入模式用于输入文本，而命令行模式用于执行编辑器命令。&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;高度可定制：Vim是一个高度可定制的编辑器，可以根据用户的需求进行个性化配置。用户可以创建自定义快捷键、绑定命令、安装插件等。&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;强大的编辑功能：Vim提供了许多强大的编辑功能，如复制、剪切、粘贴、查找替换、跳转等。它支持正则表达式搜索和多行编辑，能够处理大型文件和编程语言。&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;分屏和多标签支持：Vim可以分割编辑窗口并在同一个编辑器中同时打开多个文件。用户可以使用多个标签页来组织和切换不同的文件。&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;语法高亮：Vim支持许多编程语言的语法高亮，使代码更易于阅读和理解。&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	4.&amp;nbsp;&lt;span&gt;请简要介绍进程和程序的关系以及如何管理进程。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:18.0000pt;&quot;&gt;&#xa;	&amp;nbsp;进程和程序是计算机中重要的概念，它们之间有密切的关系，但又不完全相同&#xa;&lt;/p&gt;','2304Linux系统管理-考试',0,0,'jx23040010','2023-07-29 15:40:21','2023-07-30 16:18:49'),(12,'2304Linux系统管理-考试','&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18.0000pt;text-align:center;&quot;&gt;&#xa;	&lt;b&gt;&lt;span&gt;觉行学校&lt;/span&gt;&lt;span&gt;2304&lt;/span&gt;&lt;span&gt;班&lt;/span&gt;&lt;span&gt;Linux&lt;/span&gt;&lt;span&gt;系统管理试题&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;/b&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18.0000pt;text-align:center;&quot;&gt;&#xa;	&lt;span&gt;2023&lt;/span&gt;&lt;span&gt;年&lt;/span&gt;&lt;span&gt;7&lt;/span&gt;&lt;span&gt;月&lt;/span&gt;&lt;span&gt;28&lt;/span&gt;&lt;span&gt;日&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:18.0000pt;&quot;&gt;&#xa;	&lt;span style=&quot;font-size:32px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color:#555555;font-family:fzzh, Helvetica, Arial, sans-serif;font-size:32px;background-color:#F2F2F2;&quot;&gt;陈立兴：0&lt;/span&gt;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:18.0000pt;&quot;&gt;&#xa;	&lt;span&gt;一、填空题（每空&lt;/span&gt;&lt;span&gt;2&lt;/span&gt;&lt;span&gt;分，共&lt;/span&gt;&lt;span&gt;60&lt;/span&gt;&lt;span&gt;分）&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	1.&amp;nbsp;Linux&lt;span&gt;系统将用户的意愿转化为命令交给&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;，&lt;/span&gt;&lt;span&gt;shell&lt;/span&gt;&lt;span&gt;根据命令在&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;中创建进程操作输入输出设备。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	2.&amp;nbsp;Linux&lt;span&gt;目录结构中，&lt;/span&gt;&lt;span&gt;/etc&lt;/span&gt;&lt;span&gt;目录用于存放&lt;/span&gt;&lt;span&gt;________&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	3.&amp;nbsp;Vim&lt;span&gt;编辑器有三种模式，分别是命令模式、插入模式和&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;模式。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	4.&amp;nbsp;&lt;span&gt;用户管理包括用户和用户组信息的维护，每个用户只能属于一个主组，但可以加入多个辅助组。这些信息存储在&lt;/span&gt;/etc/______&lt;span&gt;文件中。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	5.&amp;nbsp;&lt;span&gt;文件的三组权限包括所有者权限、用户组权限和其他用户权限，分别用&lt;/span&gt;r&lt;span&gt;、&lt;/span&gt;&lt;span&gt;w&lt;/span&gt;&lt;span&gt;、&lt;/span&gt;&lt;span&gt;x&lt;/span&gt;&lt;span&gt;表示。更改权限的两种方法分别是数字表示法和&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;表示法。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	6.&amp;nbsp;&lt;span&gt;进程是程序执行的实例，具有&lt;/span&gt;PID&lt;span&gt;以及与之相关联的其他信息。通过&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;命令可以创建新任务，通过&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;命令可以查看系统资源消耗。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	7.&amp;nbsp;Linux&lt;span&gt;系统中，用于创建目录的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;，用于删除目录的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	8.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，文件的大小单位是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	9.&amp;nbsp;&lt;span&gt;查看当前工作目录的命令是&lt;/span&gt;______&lt;span&gt;，切换工作目录的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	10.&amp;nbsp;&lt;span&gt;压缩文件的常用命令有&lt;/span&gt;tar&lt;span&gt;和&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;，解压缩文件的常用命令有&lt;/span&gt;&lt;span&gt;unzip&lt;/span&gt;&lt;span&gt;和&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	11.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于显示文本文件内容的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;，用于在终端输出信息的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	12.&amp;nbsp;&lt;span&gt;在文件名后加上&lt;/span&gt;______&lt;span&gt;表示执行该文件，而不是在终端中输入命令。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	13.&amp;nbsp;&lt;span&gt;执行一条长时间运行的命令时，可以使用&lt;/span&gt;______&lt;span&gt;符号将其放入后台运行。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	14.&amp;nbsp;&lt;span&gt;将一个命令的输出作为另一个命令的输入可以使用&lt;/span&gt;______&lt;span&gt;符号。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	15.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于查询命令所在位置的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;，用于查询命令的帮助信息的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	16.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于列出文件和目录详细信息的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;，用于只列出文件和目录名称的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.00