yle=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	16.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于列出文件和目录详细信息的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;，用于只列出文件和目录名称的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	17.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于查找文件的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;，用于查找指定字符串的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	18.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于修改文件权限的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;，用于修改文件所有者的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	19.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于显示当前系统时间的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	20.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于显示正在运行的进程信息的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;，用于杀死一个进程的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	21.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于复制文件或目录的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;，用于移动文件或目录的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	22.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于打印文件内容到标准输出设备的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;，用于将标准输入设备重定向到指定文件的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	23.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于将文件或目录从本地复制到远程主机的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;，用于从远程主机复制文件或目录到本地的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	24.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于在文件中添加新内容的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;，用于用指定字符串替换文件中的某个字符串的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	25.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于挂载文件系统的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;，用于卸载文件系统的命令是&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	26.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于将多个文件合并成一个文件的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;，用于从文件中提取部分内容的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	27.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于修改用户密码的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;，用于查看当前登录用户的身份信息的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	28.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于在文件中搜索指定字符串的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;，用于在多个文件中搜索指定字符串的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	29.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于设置环境变量的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;，用于查看当前已经设置的环境变量的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	30.&amp;nbsp;&lt;span&gt;在&lt;/span&gt;Linux&lt;span&gt;系统中，用于打包文件的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;，用于解包文件的命令是&lt;/span&gt;&lt;span&gt;______&lt;/span&gt;&lt;span&gt;。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:18.0000pt;&quot;&gt;&#xa;	&lt;span&gt;二、简答题（每题&lt;/span&gt;&lt;span&gt;10&lt;/span&gt;&lt;span&gt;分，共&lt;/span&gt;&lt;span&gt;40&lt;/span&gt;&lt;span&gt;分）&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	1.&amp;nbsp;&lt;span&gt;请简要介绍&lt;/span&gt;Linux&lt;span&gt;系统的历史和特点。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	2.&amp;nbsp;&lt;span&gt;请解释一下&lt;/span&gt;Linux&lt;span&gt;系统中文件权限的含义及如何修改文件权限。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	3.&amp;nbsp;&lt;span&gt;请简要介绍&lt;/span&gt;Vim&lt;span&gt;编辑器。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; style=&quot;text-align:justify;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:36.0000pt;text-indent:-18.0000pt;&quot;&gt;&#xa;	4.&amp;nbsp;&lt;span&gt;请简要介绍进程和程序的关系以及如何管理进程。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:18.0000pt;&quot;&gt;&#xa;	&amp;nbsp;&#xa;&lt;/p&gt;','2304Linux系统管理-考试',0,0,'jx23040013','2023-07-29 15:40:21','2023-07-30 16:22:10'),(15,'2304-Shell脚本考试','&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;b&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;觉行学校2304班Shell脚本试题&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;/b&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;2023年8月8日&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;姓名：_____于文涛_______&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 分数：_____________&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;一、填空题（将脚本代码写在题目&lt;span style=&quot;font-size:24px;&quot;&gt;与&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;---------&lt;/span&gt;之间&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;）&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;1.编写函数，实现打印绿色OK和红色FAILED，判断是否有参数，存在为Ok，不存在为FAILED&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（15分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数实现两个数字做为参数，返回最大值&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并对上面两个函数做测试&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;#!/bin/bash&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;print_status() {&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; if [[ $1 -eq 0 ]]; then&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo -e &quot;\\033[32mOK\\033[0m&quot;&amp;nbsp; # Green color for OK&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; else&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo -e &quot;\\033[31mFAILED\\033[0m&quot;&amp;nbsp; # Red color for FAILED&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; fi&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;}&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;check_arguments() {&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; if [[ $1 -gt 0 ]]; then&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; return 0&amp;nbsp; # OK&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; else&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; return 1&amp;nbsp; # FAILED&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; fi&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;}&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;get_max_value() {&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; if [[ $# -eq 2 ]]; then&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; if [[ $1 -gt $2 ]]; then&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo $1&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; else&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo $2&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; fi&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; else&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;Please provide exactly two arguments&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; fi&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;}&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;# 测试 check_arguments&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;check_arguments &quot;$@&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;result_check_arguments=$?&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;print_status $result_check_arguments&lt;/span&gt;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;span&gt;# 测试 get_max_value 函数&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;num1=$1&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;num2=$2&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;max_val=$(get_max_value $num1 $num2)&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	echo &quot; 最大的数是: $max_val&quot;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;span&gt;[root@jx-apache-21 ~]# bash b.sh&amp;nbsp; 11&amp;nbsp; 123&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;OK&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp;最大的数是: 123&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;2.将/etc/passwd文件的每一行作为元数赋值给数组&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（10分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 统计文件/etc/passwd中用户使用的不同类型shell的数量&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;#!/bin/bash&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;#.将/etc/passwd文件的每一行作为元数赋值给数组&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;num=$(cat /etc/passwd | xargs)&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;#&amp;nbsp; 统计文件/etc/passwd中用户使用的不同类型shell的数量&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;shell=$(cat /etc/passwd | awk -F &quot;:&quot; &apos;{print $7}&apos; | sort | uniq -c)&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;echo &quot;用户使用的不同类型shell的数量: $shell&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;3.判断web服务是否运行&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（20分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 查看进程的方式判断该程序是否运行，&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 通过查看端口的方式判断该程序是否运行），如果没有运行，则启动该服务。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 使用curl命令访问第二题的web服务，看能否正常访问，如果能正常访问&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 则返回web server is running；如果不能正常访问，返回12状态码。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;#!/bin/bash&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;if ps aux | grep -q &quot;$1&quot;; then&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; echo &quot;进程正在运行&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;else&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; echo &quot;进程未在运行&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp;./$1&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;fi&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;if netstat -tuln | grep -q &quot;$2&quot;; then&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; echo &quot;端口正在侦听&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;else&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; echo &quot;端口未在侦听&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; ./$1&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;fi&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;response=$(curl -s -o /dev/null -w &quot;%{http_code}&quot; http://localhost:$2)&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;if [ $response -eq 200 ]; then&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; echo &quot;web server is running&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;else&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; echo &quot;12&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; exit 12&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;fi&lt;/span&gt;&lt;br /&gt;&#xa;&lt;div&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/div&gt;&#xa;&lt;span&gt;[root@jx-apache-21 ~]# bash d.sh httpd 80&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;进程正在运行&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;端口正在侦听&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;12&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;4.创建一个名为/root/foo.sh的脚本，让其提供下列特性：&lt;strong&gt;（15分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 当运行/root/foo.sh redhat，输出fedora 当运行/root/foo.sh fedora，输出redhat&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 当没有任何参数或者参数不是redhat或者fedora时，其错误输出产生以下的信息：&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; /root/foo.sh redhat|fedora&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;5.创建一个名为/root/batchusers.sh，此脚本能够实现为系统system1创建本地用户&lt;strong&gt;（20分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并且这些用户的用户名来自一个包含用户名列表的文件。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 同时满足下列要求:&amp;nbsp;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 此脚本要求提供一个参数，此参数就是包含用户名列表的文件。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 如果没有提供参数，此脚本应该给出下面的提示信息Usage: /root/batusers userfile ,&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并且退出返回相应的值。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 如果提供一个不存在的文件名，此脚本应该给出下面的提示信息&amp;nbsp;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; Input file not found然后退出并返回相应的值。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 创建的用户登录shell为/bin/false。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;6.利用SHELL编写以下内容：&lt;strong&gt;（20分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数，实现打印绿色OK和红色FAILED，判断是否有参数，存在为Ok，不存在为FAILED&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数实现两个数字做为参数，返回最大值&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 将/etc/shadow文件的每一行作为元数赋值给数组&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 统计文件/etc/passwd中用户使用的不同类型shell的数量&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 按扩展名统计指定目录中文件的数量&lt;/span&gt;&lt;br /&gt;','2304-Shell脚本考试',0,0,'jx23040001','2023-08-08 10:40:21','2023-08-08 18:01:47'),(16,'2304-Shell脚本考试','&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;b&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;觉行学校2304班Shell脚本试题&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;/b&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;2023年8月8日&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;姓名：___钱东_________&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 分数：_____________&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;一、填空题（将脚本代码写在题目&lt;span style=&quot;font-size:24px;&quot;&gt;与&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;---------&lt;/span&gt;之间&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;）&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;1.编写函数，实现打印绿色OK和红色FAILED，判断是否有参数，存在为Ok，不存在为FAILED&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（15分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数实现两个数字做为参数，返回最大值&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并对上面两个函数做测试&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;#!/bin/bash&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 函数：打印绿色OK或红色FAILED&lt;br /&gt;&#xa;print_status() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if [ $# -eq 1 ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; if [ &quot;$1&quot; = &quot;OK&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo -e &quot;\\e[32m$1\\e[0m&quot;&amp;nbsp; # 绿色&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; elif [ &quot;$1&quot; = &quot;FAILED&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo -e &quot;\\e[31m$1\\e[0m&quot;&amp;nbsp; # 红色&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 函数：返回两个数字的最大值&lt;br /&gt;&#xa;get_max() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if [ $# -eq 2 ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; if [ &quot;$1&quot; -gt &quot;$2&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;$1&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;$2&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 测试函数&lt;br /&gt;&#xa;run_tests() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; # 测试打印函数&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo -n &quot;Testing print_status function... &quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; print_status &quot;OK&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; print_status &quot;FAILED&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; print_status&amp;nbsp; # 无参数&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; # 测试最大值函数&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo -n &quot;Testing get_max function... &quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; result=$(get_max 10 5)&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Max: $result&quot;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; result=$(get_max 3 9)&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Max: $result&quot;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; result=$(get_max)&amp;nbsp; # 无参数&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Max: $result&quot;&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 执行测试函数&lt;br /&gt;&#xa;run_tests&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;div&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/div&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;color:#FF9900;background-color:#FFFFFF;&quot;&gt;-&lt;span style=&quot;color:#000000;&quot;&gt;-------------------------------------------------------------------------------------&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;2.将/etc/passwd文件的每一行作为元数赋值给数组&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（10分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 统计文件/etc/passwd中用户使用的不同类型shell的数量&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;#!/bin/bash&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 将/etc/passwd文件的每一行作为元素赋值给数组&lt;br /&gt;&#xa;readarray -t passwd_lines &amp;lt; /etc/passwd&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 初始化关联数组以统计不同类型的shell数量&lt;br /&gt;&#xa;declare -A shell_count&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 遍历数组中的每一行，提取shell类型并进行计数&lt;br /&gt;&#xa;for line in &quot;${passwd_lines[@]}&quot;; do&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; # 使用&apos;:&apos;分割每一行，获取第七列（shell）&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; shell=$(echo &quot;$line&quot; | cut -d: -f7)&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; # 忽略空shell&amp;nbsp;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if [ -n &quot;$shell&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; # 使用关联数组统计shell类型出现的次数&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; ((shell_count[&quot;$shell&quot;]++))&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;done&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 打印不同类型shell的数量&lt;br /&gt;&#xa;echo &quot;Different shell types and their counts:&quot;&lt;br /&gt;&#xa;for key in &quot;${!shell_count[@]}&quot;; do&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;$key: ${shell_count[$key]}&quot;&lt;br /&gt;&#xa;done&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;div&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/div&gt;&#xa;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;3.判断web服务是否运行&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（20分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 查看进程的方式判断该程序是否运行，&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 通过查看端口的方式判断该程序是否运行），如果没有运行，则启动该服务。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 使用curl命令访问第二题的web服务，看能否正常访问，如果能正常访问&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 则返回web server is running；如果不能正常访问，返回12状态码。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt; &lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;div&gt;&#xa;&lt;/div&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	#!/bin/bash&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 检查进程是否在运行&lt;br /&gt;&#xa;check_process() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; local process_name=&quot;$1&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if pgrep -x &quot;$process_name&quot; &amp;gt; /dev/null; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; return 0&amp;nbsp; # 进程在运行&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; return 1&amp;nbsp; # 进程未运行&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 检查端口是否在监听&lt;br /&gt;&#xa;check_port() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; local port=&quot;$1&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if ss -tln | grep -q &quot;:$port &quot;; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; return 0&amp;nbsp; # 端口在监听&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; return 1&amp;nbsp; # 端口未监听&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 启动Web服务&lt;br /&gt;&#xa;start_web_server() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Starting web server...&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; # 启动Web服务的命令，替换为实际命令&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; # 例如：/path/to/web/server/command&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 检查Web服务是否正常访问&lt;br /&gt;&#xa;check_web_access() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; local web_url=&quot;$1&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if curl -s --head &quot;$web_url&quot; | grep &quot;HTTP/1.[01] [23]..&quot; &amp;gt; /dev/null; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; return 0&amp;nbsp; # 正常访问&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; return 1&amp;nbsp; # 访问失败&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 主逻辑&lt;br /&gt;&#xa;web_process_name=&quot;web_server_process&quot;&amp;nbsp; # 替换为Web服务的进程名&lt;br /&gt;&#xa;web_port=&quot;80&quot;&amp;nbsp; # 替换为Web服务的端口号&lt;br /&gt;&#xa;web_url=&quot;http://localhost&quot;&amp;nbsp; # 替换为Web服务的URL&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;if check_process &quot;$web_process_name&quot;; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Web server process is already running.&quot;&lt;br /&gt;&#xa;else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Web server process is not running. Starting...&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; start_web_server&lt;br /&gt;&#xa;fi&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;if check_port &quot;$web_port&quot;; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Port $web_port is listening.&quot;&lt;br /&gt;&#xa;else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Port $web_port is not listening.&quot;&lt;br /&gt;&#xa;fi&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;if check_web_access &quot;$web_url&quot;; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Web server is running and accessible.&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;web server is running&quot;&amp;nbsp; # 返回给调用者&lt;br /&gt;&#xa;else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Web server is not running or not accessible.&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; exit 12&lt;br /&gt;&#xa;fi&#xa;&lt;/p&gt;&#xa;&lt;div&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/div&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;4.创建一个名为/root/foo.sh的脚本，让其提供下列特性：&lt;strong&gt;（15分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 当运行/root/foo.sh redhat，输出fedora 当运行/root/foo.sh fedora，输出redhat&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 当没有任何参数或者参数不是redhat或者fedora时，其错误输出产生以下的信息：&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; /root/foo.sh redhat|fedora&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;#!/bin/bash&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;case &quot;$1&quot; in&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &quot;redhat&quot;)&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;fedora&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; ;;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &quot;fedora&quot;)&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;redhat&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; ;;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; *)&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;$0 redhat|fedora&quot; &amp;gt;&amp;amp;2&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; exit 1&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; ;;&lt;br /&gt;&#xa;esac&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;div&gt;&#xa;	chmod +x /root/foo.sh&#xa;&lt;/div&gt;&#xa;&lt;div&gt;&#xa;	&lt;p&gt;&#xa;		&lt;br /&gt;&#xa;	&lt;/p&gt;&#xa;	&lt;p&gt;&#xa;		bash&amp;nbsp; /root/foo.sh redhat&#xa;	&lt;/p&gt;&#xa;	&lt;p&gt;&#xa;		bash /root/foo.sh fedora&#xa;	&lt;/p&gt;&#xa;	&lt;div&gt;&#xa;		bash&amp;nbsp;/root/foo.sh redhat|fedora&lt;br /&gt;&#xa;		&lt;div&gt;&#xa;			&lt;br /&gt;&#xa;		&lt;/div&gt;&#xa;	&lt;/div&gt;&#xa;	&lt;p&gt;&#xa;		&lt;br /&gt;&#xa;	&lt;/p&gt;&#xa;	&lt;div&gt;&#xa;		&lt;span style=&quot;font-size:16px;&quot;&gt;-------------------------------------------------------------------------------------&lt;/span&gt; &#xa;	&lt;/div&gt;&#xa;&lt;/div&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;5.创建一个名为/root/batchusers.sh，此脚本能够实现为系统system1创建本地用户&lt;strong&gt;（20分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并且这些用户的用户名来自一个包含用户名列表的文件。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 同时满足下列要求:&amp;nbsp;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 此脚本要求提供一个参数，此参数就是包含用户名列表的文件。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 如果没有提供参数，此脚本应该给出下面的提示信息Usage: /root/batusers userfile ,&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并且退出返回相应的值。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 如果提供一个不存在的文件名，此脚本应该给出下面的提示信息&amp;nbsp;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; Input file not found然后退出并返回相应的值。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 创建的用户登录shell为/bin/false。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;#!/bin/bash&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;userfile=&quot;$1&quot;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 检查参数是否为空&lt;br /&gt;&#xa;if [ -z &quot;$userfile&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Usage: $0 userfile&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; exit 1&lt;br /&gt;&#xa;fi&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 检查文件是否存在&lt;br /&gt;&#xa;if [ ! -f &quot;$userfile&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Input file not found.&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; exit 2&lt;br /&gt;&#xa;fi&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 逐行读取用户列表文件，并创建用户&lt;br /&gt;&#xa;while IFS= read -r username; do&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if [ -n &quot;$username&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;Creating user: $username&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; sudo useradd -m -s /bin/false &quot;$username&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;User $username created.&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;done &amp;lt; &quot;$userfile&quot;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;echo &quot;User creation process completed.&quot;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;chmod + x&amp;nbsp; /root/batchusers.sh&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;sudo /root/batchusers.sh&amp;nbsp; usernames.txt&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;div&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/div&gt;&#xa;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;6.利用SHELL编写以下内容：&lt;strong&gt;（20分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数，实现打印绿色OK和红色FAILED，判断是否有参数，存在为Ok，不存在为FAILED&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数实现两个数字做为参数，返回最大值&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 将/etc/shadow文件的每一行作为元数赋值给数组&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 统计文件/etc/passwd中用户使用的不同类型shell的数量&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 按扩展名统计指定目录中文件的数量&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;#!/bin/bash&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 函数：打印绿色OK或红色FAILED&lt;br /&gt;&#xa;print_status() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if [ $# -eq 1 ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; if [ &quot;$1&quot; = &quot;OK&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo -e &quot;\\e[32m$1\\e[0m&quot;&amp;nbsp; # 绿色&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; elif [ &quot;$1&quot; = &quot;FAILED&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo -e &quot;\\e[31m$1\\e[0m&quot;&amp;nbsp; # 红色&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 函数：返回两个数字的最大值&lt;br /&gt;&#xa;get_max() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if [ $# -eq 2 ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; if [ &quot;$1&quot; -gt &quot;$2&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;$1&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;$2&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 将/etc/shadow文件的每一行作为元素赋值给数组&lt;br /&gt;&#xa;readarray -t shadow_lines &amp;lt; /etc/shadow&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 初始化关联数组以统计不同类型的shell数量&lt;br /&gt;&#xa;declare -A shell_count&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 遍历/etc/passwd文件，统计不同类型的shell数量&lt;br /&gt;&#xa;while IFS=: read -r _ _ _ _ _ _ shell _; do&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if [ -n &quot;$shell&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; ((shell_count[&quot;$shell&quot;]++))&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;done &amp;lt; /etc/passwd&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 函数：按扩展名统计指定目录中文件的数量&lt;br /&gt;&#xa;count_files_by_extension() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; local directory=&quot;$1&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; declare -A extension_count&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; for file in &quot;$directory&quot;/*; do&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; if [ -f &quot;$file&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; extension=&quot;${file##*.}&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; ((extension_count[&quot;$extension&quot;]++))&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; done&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;File count by extension in $directory:&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; for ext in &quot;${!extension_count[@]}&quot;; do&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;$ext: ${extension_count[$ext]}&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; done&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;div&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/div&gt;&#xa;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;','2304-Shell脚本考试',0,0,'jx23040002','2023-08-08 10:40:21','2023-08-08 17:24:31'),(17,'2304-Shell脚本考试','&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;b&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;觉行学校2304班Shell脚本试题&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;/b&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;2023年8月8日&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;姓名：____崔明赫 ________&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 分数：_____________&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;一、填空题（将脚本代码写在题目&lt;span style=&quot;font-size:24px;&quot;&gt;与&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;---------&lt;/span&gt;之间&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;）&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;1.编写函数，实现打印绿色OK和红色FAILED，判断是否有参数，存在为Ok，不存在为FAILED&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（15分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数实现两个数字做为参数，返回最大值&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并对上面两个函数做测试&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;color:#FF9900;background-color:#FFFFFF;&quot;&gt;&lt;span style=&quot;color:#CCCCCC;&quot;&gt;一：&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#CCCCCC;&quot;&gt; if [ $# -gt 0 ]; then&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#CCCCCC;&quot;&gt; &amp;nbsp;echo -e&amp;nbsp; &quot;\\e[32mOK\\e[0m&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#CCCCCC;&quot;&gt; &amp;nbsp;else&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#CCCCCC;&quot;&gt; &amp;nbsp; echo -e&amp;nbsp; &quot;\\e[31mFAILED\\e[0m&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#CCCCCC;&quot;&gt; &amp;nbsp; fi&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#CCCCCC;&quot;&gt; 二：&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#CCCCCC;&quot;&gt; AB=$1&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#CCCCCC;&quot;&gt; AC=$2&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#CCCCCC;&quot;&gt; if [ $AB -gt $AC ]; then&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#CCCCCC;&quot;&gt; echo &quot;$AB&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#CCCCCC;&quot;&gt; else&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#CCCCCC;&quot;&gt; echo &quot;$AC&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#CCCCCC;&quot;&gt; fi&lt;/span&gt;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#CCCCCC;&quot;&gt; 测试：&lt;/span&gt;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#CCCCCC;&quot;&gt; 第一个：&lt;/span&gt;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#CCCCCC;&quot;&gt; bash后写参数，输出的是OK，反之是FAILED&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#CCCCCC;&quot;&gt; 第二个：&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#CCCCCC;&quot;&gt; bash后写参数1&amp;nbsp; 2 ，输出最大是 2&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#CCCCCC;&quot;&gt; -&lt;/span&gt;&lt;span style=&quot;color:#CCCCCC;&quot;&gt;-------------------------------------------------------------------------------------&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;2.将/etc/passwd文件的每一行作为元数赋值给数组&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（10分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 统计文件/etc/passwd中用户使用的不同类型shell的数量&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;3.判断web服务是否运行&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（20分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 查看进程的方式判断该程序是否运行，&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 通过查看端口的方式判断该程序是否运行），如果没有运行，则启动该服务。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 使用curl命令访问第二题的web服务，看能否正常访问，如果能正常访问&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 则返回web server is running；如果不能正常访问，返回12状态码。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;ps aux | grep httpd&lt;br /&gt;&#xa;netstat -tuln | grep 80&amp;nbsp;&lt;br /&gt;&#xa;curl http://localhost/&lt;br /&gt;&#xa;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;4.创建一个名为/root/foo.sh的脚本，让其提供下列特性：&lt;strong&gt;（15分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 当运行/root/foo.sh redhat，输出fedora 当运行/root/foo.sh fedora，输出redhat&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 当没有任何参数或者参数不是redhat或者fedora时，其错误输出产生以下的信息：&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; /root/foo.sh redhat|fedora&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;5.创建一个名为/root/batchusers.sh，此脚本能够实现为系统system1创建本地用户&lt;strong&gt;（20分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并且这些用户的用户名来自一个包含用户名列表的文件。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 同时满足下列要求:&amp;nbsp;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 此脚本要求提供一个参数，此参数就是包含用户名列表的文件。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 如果没有提供参数，此脚本应该给出下面的提示信息Usage: /root/batusers userfile ,&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并且退出返回相应的值。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 如果提供一个不存在的文件名，此脚本应该给出下面的提示信息&amp;nbsp;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; Input file not found然后退出并返回相应的值。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 创建的用户登录shell为/bin/false。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;6.利用SHELL编写以下内容：&lt;strong&gt;（20分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数，实现打印绿色OK和红色FAILED，判断是否有参数，存在为Ok，不存在为FAILED&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数实现两个数字做为参数，返回最大值&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 将/etc/shadow文件的每一行作为元数赋值给数组&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 统计文件/etc/passwd中用户使用的不同类型shell的数量&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 按扩展名统计指定目录中文件的数量&lt;/span&gt;&lt;br /&gt;','2304-Shell脚本考试',0,0,'jx23040003','2023-08-08 10:40:21','2023-08-08 17:32:44'),(18,'2304-Shell脚本考试','&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;b&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;觉行学校2304班Shell脚本试题&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;/b&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;2023年8月8日&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;姓名：____________&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 分数：_____________&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;一、填空题（将脚本代码写在题目&lt;span style=&quot;font-size:24px;&quot;&gt;与&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;---------&lt;/span&gt;之间&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;）&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;1.编写函数，实现打印绿色OK和红色FAILED，判断是否有参数，存在为Ok，不存在为FAILED&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（15分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数实现两个数字做为参数，返回最大值&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并对上面两个函数做测试&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;#!/bin/bash&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;print_status() {&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; if [[ $1 -eq 0 ]]; then&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo -e &quot;\\033[32mOK\\033[0m&quot;&amp;nbsp; # Green color for OK&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; else&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo -e &quot;\\033[31mFAILED\\033[0m&quot;&amp;nbsp; # Red color for FAILED&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; fi&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;}&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;check_arguments() {&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; if [[ $1 -gt 0 ]]; then&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; return 0&amp;nbsp; # OK&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; else&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; return 1&amp;nbsp; # FAILED&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; fi&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;}&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;get_max_value() {&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; if [[ $# -eq 2 ]]; then&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; if [[ $1 -gt $2 ]]; then&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo $1&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; else&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo $2&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; fi&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; else&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;Please provide exactly two arguments&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp; &amp;nbsp; fi&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;}&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;# 测试 check_arguments&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;check_arguments &quot;$@&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;result_check_arguments=$?&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;print_status $result_check_arguments&lt;/span&gt;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;span&gt;# 测试 get_max_value 函数&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;num1=$1&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;num2=$2&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;max_val=$(get_max_value $num1 $num2)&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	echo &quot; 最大的数是: $max_val&quot;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;span&gt;[root@jx-apache-21 ~]# bash b.sh&amp;nbsp; 11&amp;nbsp; 123&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;OK&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span&gt;&amp;nbsp;最大的数是: 123&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;2.将/etc/passwd文件的每一行作为元数赋值给数组&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（10分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 统计文件/etc/passwd中用户使用的不同类型shell的数量&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;#!/bin/bash&lt;br /&gt;&#xa;#.将/etc/passwd文件的每一行作为元数赋值给数组（10分）&lt;br /&gt;&#xa;num=$(cat /etc/passwd | xargs)&lt;br /&gt;&#xa;#&amp;nbsp; 统计文件/etc/passwd中用户使用的不同类型shell的数量&lt;br /&gt;&#xa;shell=$(cat /etc/passwd | awk -F &quot;:&quot; &apos;{print $7}&apos; | sort | uniq -c)&lt;br /&gt;&#xa;echo &quot;用户使用的不同类型shell的数量: $shell&quot;&lt;br /&gt;&#xa;&lt;div&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/div&gt;&#xa;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;3.判断web服务是否运行&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（20分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 查看进程的方式判断该程序是否运行，&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 通过查看端口的方式判断该程序是否运行），如果没有运行，则启动该服务。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 使用curl命令访问第二题的web服务，看能否正常访问，如果能正常访问&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 则返回web server is running；如果不能正常访问，返回12状态码。&lt;/span&gt;&lt;br /&gt;&#xa;#!/bin/bash&lt;br /&gt;&#xa;if ps aux | grep -q &quot;$1&quot;; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;进程正在运行&quot;&lt;br /&gt;&#xa;else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;进程未在运行&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp;./$1&lt;br /&gt;&#xa;fi&lt;br /&gt;&#xa;if netstat -tuln | grep -q &quot;$2&quot;; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;端口正在侦听&quot;&lt;br /&gt;&#xa;else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;端口未在侦听&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; ./$1&lt;br /&gt;&#xa;fi&lt;br /&gt;&#xa;response=$(curl -s -o /dev/null -w &quot;%{http_code}&quot; http://localhost:$2)&lt;br /&gt;&#xa;if [ $response -eq 200 ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;web server is running&quot;&lt;br /&gt;&#xa;else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;12&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; exit 12&lt;br /&gt;&#xa;fi&lt;br /&gt;&#xa;&lt;div&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/div&gt;&#xa;[root@jx-apache-21 ~]# bash d.sh httpd 80&lt;br /&gt;&#xa;进程正在运行&lt;br /&gt;&#xa;端口正在侦听&lt;br /&gt;&#xa;12&lt;br /&gt;&#xa;&lt;div&gt;&#xa;&lt;/div&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;4.创建一个名为/root/foo.sh的脚本，让其提供下列特性：&lt;strong&gt;（15分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 当运行/root/foo.sh redhat，输出fedora 当运行/root/foo.sh fedora，输出redhat&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 当没有任何参数或者参数不是redhat或者fedora时，其错误输出产生以下的信息：&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; /root/foo.sh redhat|fedora&lt;/span&gt;&lt;br /&gt;&#xa;#!/bin/bash&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;if [ $# -eq 1 ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if [ &quot;$1&quot; = &quot;redhat&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;fedora&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; elif [ &quot;$1&quot; = &quot;fedora&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;redhat&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;gt;&amp;amp;2 echo &quot;/root/foo.sh redhat|fedora&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; exit 1&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;gt;&amp;amp;2 echo &quot;/root/foo.sh redhat|fedora&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; exit 1&lt;br /&gt;&#xa;fi&lt;br /&gt;&#xa;&lt;div&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/div&gt;&#xa;[root@jx-apache-21 ~]# bash foo.sh redhat&lt;br /&gt;&#xa;fedora&lt;br /&gt;&#xa;[root@jx-apache-21 ~]# bash foo.sh&amp;nbsp;&lt;br /&gt;&#xa;/root/foo.sh redhat|fedora&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;5.创建一个名为/root/batchusers.sh，此脚本能够实现为系统system1创建本地用户&lt;strong&gt;（20分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并且这些用户的用户名来自一个包含用户名列表的文件。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 同时满足下列要求:&amp;nbsp;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 此脚本要求提供一个参数，此参数就是包含用户名列表的文件。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 如果没有提供参数，此脚本应该给出下面的提示信息Usage: /root/batusers userfile ,&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并且退出返回相应的值。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 如果提供一个不存在的文件名，此脚本应该给出下面的提示信息&amp;nbsp;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; Input file not found然后退出并返回相应的值。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 创建的用户登录shell为/bin/false。&lt;/span&gt;&lt;br /&gt;&#xa;#!/bin/bash&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;if [ $# -ne 1 ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;用法：/root/batchusers.sh userfile&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; exit 1&lt;br /&gt;&#xa;fi&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;userfile=&quot;$1&quot;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;if [ ! -f &quot;$userfile&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;输入文件不存在&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; exit 2&lt;br /&gt;&#xa;fi&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;while IFS= read -r username; do&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; # 检查用户是否已存在&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if id &quot;$username&quot; &amp;amp;&amp;gt;/dev/null; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;用户 $username 已存在，跳过。&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; # 使用 /bin/false 作为登录 shell 创建用户&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; useradd -m -s /bin/false &quot;$username&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;用户 $username 创建成功。&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;done &amp;lt; &quot;$userfile&quot;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	echo &quot;批量用户创建完成。&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	cat /etc/passwd&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	aa:x:1000:1000::/home/aa:/bin/false&#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;6.利用SHELL编写以下内容：&lt;strong&gt;（20分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数，实现打印绿色OK和红色FAILED，判断是否有参数，存在为Ok，不存在为FAILED&lt;/span&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;print_status() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if [ $# -eq 1 ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo -e &quot;\\e[32mOK\\e[0m&quot;&amp;nbsp; &amp;nbsp; # 绿色 OK&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo -e &quot;\\e[31mFAILED\\e[0m&quot;&amp;nbsp; # 红色 FAILED&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 测试&lt;br /&gt;&#xa;print_status &quot;parameter&quot;&amp;nbsp; &amp;nbsp;# 输出：OK（绿色）&lt;br /&gt;&#xa;print_status&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; # 输出：FAILED（红色）&lt;br /&gt;&#xa;	&lt;div&gt;&#xa;	&lt;/div&gt;&#xa;&lt;/span&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数实现两个数字做为参数，返回最大值&lt;/span&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;get_max() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if [ &quot;$1&quot; -gt &quot;$2&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;$1&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;$2&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 测试&lt;br /&gt;&#xa;result=$(get_max 5 9)&lt;br /&gt;&#xa;echo &quot;最大值是：$result&quot;&lt;br /&gt;&#xa;	&lt;div&gt;&#xa;		&lt;br /&gt;&#xa;	&lt;/div&gt;&#xa;&lt;br /&gt;&#xa;&lt;/span&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 将/etc/shadow文件的每一行作为元数赋值给数组&lt;/span&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;br /&gt;&#xa;	&lt;div&gt;&#xa;	&lt;/div&gt;&#xa;&lt;/span&gt;&#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 统计文件/etc/passwd中用户使用的不同类型shell的数量&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 按扩展名统计指定目录中文件的数量&lt;/span&gt;&lt;br /&gt;','2304-Shell脚本考试',0,0,'jx23040004','2023-08-08 10:40:21','2023-08-08 17:32:18'),(19,'2304-Shell脚本考试','&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;b&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;觉行学校2304班Shell脚本试题&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;/b&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;2023年8月8日&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;姓名：____________&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 分数：_____________&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;一、填空题（将脚本代码写在题目&lt;span style=&quot;font-size:24px;&quot;&gt;与&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;---------&lt;/span&gt;之间&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;）&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;1.编写函数，实现打印绿色OK和红色FAILED，判断是否有参数，存在为Ok，不存在为FAILED&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（15分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数实现两个数字做为参数，返回最大值&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并对上面两个函数做测试&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;background-color:#FFFFFF;font-size:16px;color:#E53333;&quot;&gt;第一个：&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;background-color:#FFFFFF;font-size:16px;color:#E53333;&quot;&gt;if [ $# -gt 0 ]; then&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;background-color:#FFFFFF;font-size:16px;color:#E53333;&quot;&gt;&amp;nbsp;echo -e&amp;nbsp; &quot;\\e[32mOK\\e[0m&quot;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;color:#FF9900;background-color:#FFFFFF;&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;color:#E53333;&quot;&gt;&amp;nbsp;else&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;&quot;&gt; &amp;nbsp; echo -e&amp;nbsp; &quot;\\e[31mFAILED\\e[0m&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;/span&gt;&lt;/span&gt; &#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;color:#E53333;background-color:#FFFFFF;&quot;&gt;&lt;span style=&quot;color:#E53333;&quot;&gt;&amp;nbsp; fi&lt;/span&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;color:#E53333;background-color:#FFFFFF;&quot;&gt;&lt;span style=&quot;color:#E53333;&quot;&gt;第二个：&lt;/span&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;color:#FF9900;background-color:#FFFFFF;&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;color:#E53333;&quot;&gt;AOO=$1&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;&quot;&gt; ASS=$2&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;&quot;&gt; if [ $AOO -gt $ASS ]; then&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;&quot;&gt; echo &quot;$AOO&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;&quot;&gt; else&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;&quot;&gt; echo &quot;$ASS&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;&quot;&gt; fi&lt;/span&gt;&lt;br /&gt;&#xa;&lt;/span&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;color:#E53333;&quot;&gt; 测试： &lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;color:#E53333;&quot;&gt; 第一个： &lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;background-color:#FFFFFF;color:#E53333;&quot;&gt;bash后写参数，输出的就是OK，反之是F&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;background-color:#FFFFFF;color:#E53333;&quot;&gt;第二个：&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;background-color:#FFFFFF;color:#E53333;&quot;&gt;bash后写参数1 2 ，输出最大是2&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;color:#FF9900;background-color:#FFFFFF;&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;-----------------------------------------------------------------&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;2.将/etc/passwd文件的每一行作为元数赋值给数组&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（10分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 统计文件/etc/passwd中用户使用的不同类型shell的数量&lt;/span&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color:#E53333;&quot;&gt;userer=( $(cat /etc/passwd | awk &apos;{print $1}&apos; ) )&lt;/span&gt;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;&quot;&gt;shelle=0&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;&quot;&gt;for shell in &quot;${userer[@]}&quot;; do&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;&quot;&gt;&amp;nbsp; &amp;nbsp; shelle=$((shelle + 1))&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;&quot;&gt;done&lt;/span&gt;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;&quot;&gt;echo &quot;数量: $shelle&quot;&lt;/span&gt;&lt;br /&gt;&#xa;	&lt;div&gt;&#xa;		&lt;br /&gt;&#xa;	&lt;/div&gt;&#xa;&lt;br /&gt;&#xa;&lt;/span&gt;&#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;3.判断web服务是否运行&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（20分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 查看进程的方式判断该程序是否运行，&lt;/span&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;通过查看端口的方式判断该程序是否运行），如果没有运行，则启动该服务。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 使用curl命令访问第二题的web服务，看能否正常访问，如果能正常访问&lt;/span&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;则返回web server is running；如果不能正常访问，返回12状态码。&lt;/span&gt; &#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;color:#E53333;&quot;&gt;ps aux | grep httpd&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;color:#E53333;&quot;&gt;netstat -tuln | grep 80&amp;nbsp;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color:#E53333;&quot;&gt;curl http://localhost/&lt;/span&gt;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;4.创建一个名为/root/foo.sh的脚本，让其提供下列特性：&lt;strong&gt;（15分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 当运行/root/foo.sh redhat，输出fedora 当运行/root/foo.sh fedora，输出redhat&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 当没有任何参数或者参数不是redhat或者fedora时，其错误输出产生以下的信息：&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; /root/foo.sh redhat|fedora&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color:#E53333;&quot;&gt;if [ &quot;$1&quot; = &quot;redhat&quot; ]; then&lt;/span&gt;&lt;br /&gt;&#xa;&amp;nbsp;&lt;span style=&quot;color:#E53333;&quot;&gt; &amp;nbsp; echo &quot;fedora&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;&quot;&gt;elif [ &quot;$1&quot; = &quot;fedora&quot; ]; then&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;&quot;&gt;echo &quot;redhat&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;&quot;&gt;else&amp;nbsp;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;&quot;&gt;echo &quot;/root/foo.sh redhat|fedora&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;&quot;&gt;fi&lt;/span&gt;&lt;br /&gt;&#xa;&lt;/span&gt;&#xa;&lt;/p&gt;&#xa;&lt;div&gt;&#xa;&lt;/div&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;5.创建一个名为/root/batchusers.sh，此脚本能够实现为系统system1创建本地用户&lt;strong&gt;（20分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并且这些用户的用户名来自一个包含用户名列表的文件。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 同时满足下列要求:&amp;nbsp;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 此脚本要求提供一个参数，此参数就是包含用户名列表的文件。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 如果没有提供参数，此脚本应该给出下面的提示信息Usage: /root/batusers userfile ,&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并且退出返回相应的值。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 如果提供一个不存在的文件名，此脚本应该给出下面的提示信息&amp;nbsp;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; Input file not found然后退出并返回相应的值。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 创建的用户登录shell为/bin/false。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;6.利用SHELL编写以下内容：&lt;strong&gt;（20分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数，实现打印绿色OK和红色FAILED，判断是否有参数，存在为Ok，不存在为FAILED&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数实现两个数字做为参数，返回最大值&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 将/etc/shadow文件的每一行作为元数赋值给数组&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 统计文件/etc/passwd中用户使用的不同类型shell的数量&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 按扩展名统计指定目录中文件的数量&lt;/span&gt;&lt;br /&gt;','2304-Shell脚本考试',0,0,'jx23040005','2023-08-08 10:40:21','2023-08-08 17:31:07'),(20,'2304-Shell脚本考试','&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;b&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;觉行学校2304班Shell脚本试题&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;/b&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;2023年8月8日&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;姓名：____________&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 分数：_____________&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;一、填空题（将脚本代码写在题目&lt;span style=&quot;font-size:24px;&quot;&gt;与&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;---------&lt;/span&gt;之间&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;）&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;1.编写函数，实现打印绿色OK和红色FAILED，判断是否有参数，存在为Ok，不存在为FAILED&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（15分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数实现两个数字做为参数，返回最大值&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并对上面两个函数做测试&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;color:#FF9900;background-color:#FFFFFF;&quot;&gt;-&lt;span style=&quot;color:#000000;&quot;&gt;-------------------------------------------------------------------------------------&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;2.将/etc/passwd文件的每一行作为元数赋值给数组&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（10分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 统计文件/etc/passwd中用户使用的不同类型shell的数量&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;#!/bin/bash&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;#读取 /etc/passwd 文件的每一行并将其作为数组元素&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;readarray -t passwd &amp;lt; /etc/passwd&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;#创建关联数组来存储不同类型shell的数量&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;declare -A shuzu&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;#提取shell类型并统计数量&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;for i&amp;nbsp; in &quot;${passwd[@]}&quot;; do&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;&amp;nbsp; &amp;nbsp;shell=$(echo $i | awk -F &quot;:&quot; &apos;{print $7}&apos;)&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;&amp;nbsp; &amp;nbsp;#统计不同的shell类型&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;&amp;nbsp; if [[ -n &quot;$shell&quot; || &quot;$shell&quot; != &quot;/sbin/nologin&quot; ]]; then&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; if [[ -v shuzu[&quot;$shell&quot;] ]]; then&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;((shuzu[&quot;$shell&quot;]++))&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; else&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;shuzu[&quot;$shell&quot;]=1&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; fi&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;&amp;nbsp; fi&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;done&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;#打印不同类型的shell的统计结果&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;echo &quot;不同类型 shell 的数量统计&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;for k in &quot;${!shuzu[@]}&quot;; do&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;&amp;nbsp; &amp;nbsp; echo &quot;$k: ${shuzu[&quot;$k&quot;]} 个&quot;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;done&lt;/span&gt;&lt;br /&gt;&#xa;&lt;div&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/div&gt;&#xa;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;3.判断web服务是否运行&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（20分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 查看进程的方式判断该程序是否运行，&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 通过查看端口的方式判断该程序是否运行），如果没有运行，则启动该服务。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 使用curl命令访问第二题的web服务，看能否正常访问，如果能正常访问&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 则返回web server is running；如果不能正常访问，返回12状态码。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;4.创建一个名为/root/foo.sh的脚本，让其提供下列特性：&lt;strong&gt;（15分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 当运行/root/foo.sh redhat，输出fedora 当运行/root/foo.sh fedora，输出redhat&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 当没有任何参数或者参数不是redhat或者fedora时，其错误输出产生以下的信息：&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; /root/foo.sh redhat|fedora&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;5.创建一个名为/root/batchusers.sh，此脚本能够实现为系统system1创建本地用户&lt;strong&gt;（20分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并且这些用户的用户名来自一个包含用户名列表的文件。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 同时满足下列要求:&amp;nbsp;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 此脚本要求提供一个参数，此参数就是包含用户名列表的文件。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 如果没有提供参数，此脚本应该给出下面的提示信息Usage: /root/batusers userfile ,&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并且退出返回相应的值。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 如果提供一个不存在的文件名，此脚本应该给出下面的提示信息&amp;nbsp;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; Input file not found然后退出并返回相应的值。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 创建的用户登录shell为/bin/false。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;6.利用SHELL编写以下内容：&lt;strong&gt;（20分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数，实现打印绿色OK和红色FAILED，判断是否有参数，存在为Ok，不存在为FAILED&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数实现两个数字做为参数，返回最大值&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 将/etc/shadow文件的每一行作为元数赋值给数组&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 统计文件/etc/passwd中用户使用的不同类型shell的数量&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 按扩展名统计指定目录中文件的数量&lt;/span&gt;&lt;br /&gt;','2304-Shell脚本考试',0,0,'jx23040006','2023-08-08 10:40:21','2023-08-08 15:35:42'),(21,'2304-Shell脚本考试','&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;b&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;觉行学校2304班Shell脚本试题&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;/b&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;2023年8月8日&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;姓名：____边志强________&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 分数：_____________&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;一、填空题（将脚本代码写在题目&lt;span style=&quot;font-size:24px;&quot;&gt;与&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;---------&lt;/span&gt;之间&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;）&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;1.编写函数，实现打印绿色OK和红色FAILED，判断是否有参数，存在为Ok，不存在为FAILED&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（15分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数实现两个数字做为参数，返回最大值&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并对上面两个函数做测试&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;第一个：&lt;br /&gt;&#xa;if [ $# -gt 0 ]; then&lt;br /&gt;&#xa;&amp;nbsp;echo -e&amp;nbsp; &quot;\\e[32mOK\\e[0m&quot;&lt;br /&gt;&#xa;&amp;nbsp;else&lt;br /&gt;&#xa;&amp;nbsp; echo -e&amp;nbsp; &quot;\\e[31mFAILED\\e[0m&quot;&lt;br /&gt;&#xa;&amp;nbsp; fi&lt;br /&gt;&#xa;第二个：&lt;br /&gt;&#xa;AOO=$1&lt;br /&gt;&#xa;ASS=$2&lt;br /&gt;&#xa;if [ $AOO -gt $ASS ]; then&lt;br /&gt;&#xa;echo &quot;$AOO&quot;&lt;br /&gt;&#xa;else&lt;br /&gt;&#xa;echo &quot;$ASS&quot;&lt;br /&gt;&#xa;fi&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;测试：&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;第一个：&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;bash后写参数，输出的就是OK，反之是F&lt;br /&gt;&#xa;第二个：&lt;br /&gt;&#xa;bash后写参数1 2 ，输出最大是2&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;color:#FF9900;background-color:#FFFFFF;&quot;&gt;-&lt;span style=&quot;color:#000000;&quot;&gt;-------------------------------------------------------------------------------------&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;2.将/etc/passwd文件的每一行作为元数赋值给数组&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（10分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 统计文件/etc/passwd中用户使用的不同类型shell的数量&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;#!/bin/bash&lt;br /&gt;&#xa;#读取 /etc/passwd 文件的每一行并将其作为数组元素&lt;br /&gt;&#xa;readarray -t passwd &amp;lt; /etc/passwd&lt;br /&gt;&#xa;#创建关联数组来存储不同类型shell的数量&lt;br /&gt;&#xa;declare -A shuzu&lt;br /&gt;&#xa;#提取shell类型并统计数量&lt;br /&gt;&#xa;for i&amp;nbsp; in &quot;${passwd[@]}&quot;; do&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp;shell=$(echo $i | awk -F &quot;:&quot; &apos;{print $7}&apos;)&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp;#统计不同的shell类型&lt;br /&gt;&#xa;&amp;nbsp; if [[ -n &quot;$shell&quot; || &quot;$shell&quot; != &quot;/sbin/nologin&quot; ]]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; if [[ -v shuzu[&quot;$shell&quot;] ]]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;((shuzu[&quot;$shell&quot;]++))&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;shuzu[&quot;$shell&quot;]=1&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;&amp;nbsp; fi&lt;br /&gt;&#xa;done&lt;br /&gt;&#xa;#打印不同类型的shell的统计结果&lt;br /&gt;&#xa;echo &quot;不同类型 shell 的数量统计&quot;&lt;br /&gt;&#xa;for k in &quot;${!shuzu[@]}&quot;; do&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;$k: ${shuzu[&quot;$k&quot;]} 个&quot;&lt;br /&gt;&#xa;done&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;3.判断web服务是否运行&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（20分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 查看进程的方式判断该程序是否运行，&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 通过查看端口的方式判断该程序是否运行），如果没有运行，则启动该服务。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 使用curl命令访问第二题的web服务，看能否正常访问，如果能正常访问&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 则返回web server is running；如果不能正常访问，返回12状态码。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;ps aux | grep httpd&lt;br /&gt;&#xa;netstat -tuln | grep 80&amp;nbsp;&lt;br /&gt;&#xa;curl http://localhost/&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;4.创建一个名为/root/foo.sh的脚本，让其提供下列特性：&lt;strong&gt;（15分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 当运行/root/foo.sh redhat，输出fedora 当运行/root/foo.sh fedora，输出redhat&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 当没有任何参数或者参数不是redhat或者fedora时，其错误输出产生以下的信息：&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; /root/foo.sh redhat|fedora&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;if [ &quot;$1&quot; = &quot;redhat&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;fedora&quot;&lt;br /&gt;&#xa;elif [ &quot;$1&quot; = &quot;fedora&quot; ]; then&lt;br /&gt;&#xa;echo &quot;redhat&quot;&lt;br /&gt;&#xa;else&amp;nbsp;&lt;br /&gt;&#xa;echo &quot;/root/foo.sh redhat|fedora&quot;&lt;br /&gt;&#xa;fi&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;5.创建一个名为/root/batchusers.sh，此脚本能够实现为系统system1创建本地用户&lt;strong&gt;（20分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并且这些用户的用户名来自一个包含用户名列表的文件。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 同时满足下列要求:&amp;nbsp;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 此脚本要求提供一个参数，此参数就是包含用户名列表的文件。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 如果没有提供参数，此脚本应该给出下面的提示信息Usage: /root/batusers userfile ,&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并且退出返回相应的值。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 如果提供一个不存在的文件名，此脚本应该给出下面的提示信息&amp;nbsp;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; Input file not found然后退出并返回相应的值。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 创建的用户登录shell为/bin/false。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;6.利用SHELL编写以下内容：&lt;strong&gt;（20分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数，实现打印绿色OK和红色FAILED，判断是否有参数，存在为Ok，不存在为FAILED&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数实现两个数字做为参数，返回最大值&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 将/etc/shadow文件的每一行作为元数赋值给数组&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 统计文件/etc/passwd中用户使用的不同类型shell的数量&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 按扩展名统计指定目录中文件的数8&lt;/span&gt;&lt;br /&gt;','2304-Shell脚本考试',0,0,'jx23040007','2023-08-08 10:40:21','2023-08-08 17:32:13'),(22,'2304-Shell脚本考试','&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt