&gt;&amp;nbsp; 统计文件/etc/passwd中用户使用的不同类型shell的数量&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 按扩展名统计指定目录中文件的数量&lt;/span&gt;&lt;br /&gt;','2304-Shell脚本考试',0,0,'jx23040009','2023-08-08 10:40:21','2023-08-08 10:03:33'),(24,'2304-Shell脚本考试','&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;b&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;觉行学校2304班Shell脚本试题&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;/b&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;2023年8月8日&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;姓名：__毛晓磊__________&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 分数：_____________&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;一、填空题（将脚本代码写在题目&lt;span style=&quot;font-size:24px;&quot;&gt;与&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;---------&lt;/span&gt;之间&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;）&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;1.编写函数，实现打印绿色OK和红色FAILED，判断是否有参数，存在为Ok，不存在为FAILED&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（15分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数实现两个数字做为参数，返回最大值&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并对上面两个函数做测试&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;#!/bin/bash&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 函数：打印绿色OK或红色FAILED&lt;br /&gt;&#xa;print_status() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if [ $# -eq 1 ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; if [ &quot;$1&quot; = &quot;OK&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo -e &quot;\\e[32m$1\\e[0m&quot;&amp;nbsp; # 绿色&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; elif [ &quot;$1&quot; = &quot;FAILED&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo -e &quot;\\e[31m$1\\e[0m&quot;&amp;nbsp; # 红色&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 函数：返回两个数字的最大值&lt;br /&gt;&#xa;get_max() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if [ $# -eq 2 ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; if [ &quot;$1&quot; -gt &quot;$2&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;$1&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;$2&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 测试函数&lt;br /&gt;&#xa;run_tests() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; # 测试打印函数&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo -n &quot;Testing print_status function... &quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; print_status &quot;OK&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; print_status &quot;FAILED&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; print_status&amp;nbsp; # 无参数&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; # 测试最大值函数&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo -n &quot;Testing get_max function... &quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; result=$(get_max 10 5)&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Max: $result&quot;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; result=$(get_max 3 9)&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Max: $result&quot;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; result=$(get_max)&amp;nbsp; # 无参数&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Max: $result&quot;&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 执行测试函数&lt;br /&gt;&#xa;run_tests&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;color:#FF9900;background-color:#FFFFFF;&quot;&gt;-&lt;span style=&quot;color:#000000;&quot;&gt;-------------------------------------------------------------------------------------&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;2.将/etc/passwd文件的每一行作为元数赋值给数组&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（10分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 统计文件/etc/passwd中用户使用的不同类型shell的数量&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;#!/bin/bash&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 将/etc/passwd文件的每一行作为元素赋值给数组&lt;br /&gt;&#xa;readarray -t passwd_lines &amp;lt; /etc/passwd&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 初始化关联数组以统计不同类型的shell数量&lt;br /&gt;&#xa;declare -A shell_count&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 遍历数组中的每一行，提取shell类型并进行计数&lt;br /&gt;&#xa;for line in &quot;${passwd_lines[@]}&quot;; do&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; # 使用&apos;:&apos;分割每一行，获取第七列（shell）&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; shell=$(echo &quot;$line&quot; | cut -d: -f7)&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; # 忽略空shell&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if [ -n &quot;$shell&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; # 使用关联数组统计shell类型出现的次数&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; ((shell_count[&quot;$shell&quot;]++))&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;done&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 打印不同类型shell的数量&lt;br /&gt;&#xa;echo &quot;Different shell types and their counts:&quot;&lt;br /&gt;&#xa;for key in &quot;${!shell_count[@]}&quot;; do&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;$key: ${shell_count[$key]}&quot;&lt;br /&gt;&#xa;done&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;3.判断web服务是否运行&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（20分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 查看进程的方式判断该程序是否运行，&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 通过查看端口的方式判断该程序是否运行），如果没有运行，则启动该服务。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 使用curl命令访问第二题的web服务，看能否正常访问，如果能正常访问&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 则返回web server is running；如果不能正常访问，返回12状态码。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;#!/bin/bash&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 检查进程是否在运行&lt;br /&gt;&#xa;check_process() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; local process_name=&quot;$1&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if pgrep -x &quot;$process_name&quot; &amp;gt; /dev/null; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; return 0&amp;nbsp; # 进程在运行&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; return 1&amp;nbsp; # 进程未运行&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 检查端口是否在监听&lt;br /&gt;&#xa;check_port() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; local port=&quot;$1&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if ss -tln | grep -q &quot;:$port &quot;; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; return 0&amp;nbsp; # 端口在监听&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; return 1&amp;nbsp; # 端口未监听&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 启动Web服务&lt;br /&gt;&#xa;start_web_server() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; # 假设你需要执行启动Web服务的命令，替换下面的内容&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Starting web server...&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; # 启动命令示例：&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; # /path/to/web/server/command&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 检查Web服务是否正常访问&lt;br /&gt;&#xa;check_web_access() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; local web_url=&quot;$1&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if curl -s --head &quot;$web_url&quot; | grep &quot;HTTP/1.[01] [23]..&quot; &amp;gt; /dev/null; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; return 0&amp;nbsp; # 正常访问&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; return 1&amp;nbsp; # 访问失败&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 主逻辑&lt;br /&gt;&#xa;web_process_name=&quot;web_server_process&quot;&amp;nbsp; # 替换为你的Web服务进程名&lt;br /&gt;&#xa;web_port=&quot;80&quot;&amp;nbsp; # 替换为你的Web服务端口号&lt;br /&gt;&#xa;web_url=&quot;http://localhost&quot;&amp;nbsp; # 替换为你的Web服务URL&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;if check_process &quot;$web_process_name&quot;; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Web server process is already running.&quot;&lt;br /&gt;&#xa;else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Web server process is not running. Starting...&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; start_web_server&lt;br /&gt;&#xa;fi&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;if check_port &quot;$web_port&quot;; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Port $web_port is listening.&quot;&lt;br /&gt;&#xa;else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Port $web_port is not listening.&quot;&lt;br /&gt;&#xa;fi&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;if check_web_access &quot;$web_url&quot;; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Web server is running and accessible.&quot;&lt;br /&gt;&#xa;else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Web server is not running or not accessible.&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; exit 12&lt;br /&gt;&#xa;fi&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;4.创建一个名为/root/foo.sh的脚本，让其提供下列特性：&lt;strong&gt;（15分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 当运行/root/foo.sh redhat，输出fedora 当运行/root/foo.sh fedora，输出redhat&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 当没有任何参数或者参数不是redhat或者fedora时，其错误输出产生以下的信息：&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; /root/foo.sh redhat|fedora&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;#!/bin/bash&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;case &quot;$1&quot; in&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &quot;redhat&quot;)&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;fedora&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; ;;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &quot;fedora&quot;)&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;redhat&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; ;;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; *)&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;$0 redhat|fedora&quot; &amp;gt;&amp;amp;2&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; exit 1&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; ;;&lt;br /&gt;&#xa;esac&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;/span&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;5.创建一个名为/root/batchusers.sh，此脚本能够实现为系统system1创建本地用户&lt;strong&gt;（20分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并且这些用户的用户名来自一个包含用户名列表的文件。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 同时满足下列要求:&amp;nbsp;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 此脚本要求提供一个参数，此参数就是包含用户名列表的文件。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 如果没有提供参数，此脚本应该给出下面的提示信息Usage: /root/batusers userfile ,&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并且退出返回相应的值。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 如果提供一个不存在的文件名，此脚本应该给出下面的提示信息&amp;nbsp;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; Input file not found然后退出并返回相应的值。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 创建的用户登录shell为/bin/false。&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;#!/bin/bash&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;userfile=&quot;$1&quot;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 检查参数是否为空&lt;br /&gt;&#xa;if [ -z &quot;$userfile&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Usage: $0 userfile&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; exit 1&lt;br /&gt;&#xa;fi&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 检查文件是否存在&lt;br /&gt;&#xa;if [ ! -f &quot;$userfile&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;Input file not found.&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; exit 2&lt;br /&gt;&#xa;fi&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 逐行读取用户列表文件，并创建用户&lt;br /&gt;&#xa;while IFS= read -r username; do&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if [ -n &quot;$username&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;Creating user: $username&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; sudo useradd -m -s /bin/false &quot;$username&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;User $username created.&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;done &amp;lt; &quot;$userfile&quot;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;echo &quot;User creation process completed.&quot;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;6.利用SHELL编写以下内容：&lt;strong&gt;（20分）&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数，实现打印绿色OK和红色FAILED，判断是否有参数，存在为Ok，不存在为FAILED&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数实现两个数字做为参数，返回最大值&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 将/etc/shadow文件的每一行作为元数赋值给数组&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 统计文件/etc/passwd中用户使用的不同类型shell的数量&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 按扩展名统计指定目录中文件的数量&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;#!/bin/bash&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 函数：打印绿色OK或红色FAILED&lt;br /&gt;&#xa;print_status() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if [ $# -eq 1 ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; if [ &quot;$1&quot; = &quot;OK&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo -e &quot;\\e[32m$1\\e[0m&quot;&amp;nbsp; # 绿色&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; elif [ &quot;$1&quot; = &quot;FAILED&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo -e &quot;\\e[31m$1\\e[0m&quot;&amp;nbsp; # 红色&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 函数：返回两个数字的最大值&lt;br /&gt;&#xa;get_max() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if [ $# -eq 2 ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; if [ &quot;$1&quot; -gt &quot;$2&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;$1&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;$2&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 将/etc/shadow文件的每一行作为元素赋值给数组&lt;br /&gt;&#xa;readarray -t shadow_lines &amp;lt; /etc/shadow&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 初始化关联数组以统计不同类型的shell数量&lt;br /&gt;&#xa;declare -A shell_count&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 遍历/etc/passwd文件，统计不同类型shell的数量&lt;br /&gt;&#xa;count_shell_types() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; while IFS=: read -r _ _ _ _ _ _ shell _; do&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; if [ -n &quot;$shell&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; ((shell_count[&quot;$shell&quot;]++))&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; done &amp;lt; /etc/passwd&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 函数：按扩展名统计指定目录中文件的数量&lt;br /&gt;&#xa;count_files_by_extension() {&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; local dir=&quot;$1&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; if [ -d &quot;$dir&quot; ]; then&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;File count by extension in directory &apos;$dir&apos;:&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; find &quot;$dir&quot; -type f | sed -E &apos;s/.*\\.([^\\.]+)$/\\1/&apos; | sort | uniq -c&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; else&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; echo &quot;Directory &apos;$dir&apos; does not exist.&quot;&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; fi&lt;br /&gt;&#xa;}&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;# 主逻辑&lt;br /&gt;&#xa;echo &quot;=== Testing Functions ===&quot;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;echo -n &quot;Printing status... &quot;&lt;br /&gt;&#xa;print_status &quot;OK&quot;&lt;br /&gt;&#xa;print_status &quot;FAILED&quot;&lt;br /&gt;&#xa;print_status&amp;nbsp; # 无参数&lt;br /&gt;&#xa;echo&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;echo -n &quot;Finding max value... &quot;&lt;br /&gt;&#xa;result=$(get_max 10 5)&lt;br /&gt;&#xa;echo &quot;Max: $result&quot;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;result=$(get_max 3 9)&lt;br /&gt;&#xa;echo &quot;Max: $result&quot;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;result=$(get_max)&amp;nbsp; # 无参数&lt;br /&gt;&#xa;echo &quot;Max: $result&quot;&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;echo &quot;=== Counting Shell Types ===&quot;&lt;br /&gt;&#xa;count_shell_types&lt;br /&gt;&#xa;for key in &quot;${!shell_count[@]}&quot;; do&lt;br /&gt;&#xa;&amp;nbsp; &amp;nbsp; echo &quot;$key: ${shell_count[$key]}&quot;&lt;br /&gt;&#xa;done&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;echo &quot;=== Counting Files by Extension ===&quot;&lt;br /&gt;&#xa;count_files_by_extension &quot;/path/to/directory&quot;&amp;nbsp; # 替换为实际目录路径&lt;br /&gt;&#xa;&lt;br /&gt;&#xa;&lt;/span&gt; &#xa;&lt;/p&gt;','2304-Shell脚本考试',0,0,'jx23040010','2023-08-08 10:40:21','2023-08-08 17:31:44'),(25,'2304-Shell脚本考试','&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;b&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;觉行学校2304班Shell脚本试题&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;/b&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;2023年8月8日&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; style=&quot;margin-left:18pt;text-align:center;&quot;&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;姓名：____________&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 分数：_____________&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;br /&gt;&#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:24px;&quot;&gt;一、填空题（将脚本代码写在题目&lt;span style=&quot;font-size:24px;&quot;&gt;与&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;---------&lt;/span&gt;之间&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;）&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;1.编写函数，实现打印绿色OK和红色FAILED，判断是否有参数，存在为Ok，不存在为FAILED&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（15分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 编写函数实现两个数字做为参数，返回最大值&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 并对上面两个函数做测试&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;color:#FF9900;background-color:#FFFFFF;&quot;&gt;-&lt;span style=&quot;color:#000000;&quot;&gt;-------------------------------------------------------------------------------------&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;2.将/etc/passwd文件的每一行作为元数赋值给数组&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（10分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 统计文件/etc/passwd中用户使用的不同类型shell的数量&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;3.判断web服务是否运行&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;（20分）&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;p&gt;&#xa;	&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 查看进程的方式判断该程序是否运行，&lt;/span&gt; &#xa;&lt;/p&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 通过查看端口的方式判断该程序是否运行），如果没有运行，则启动该服务。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 使用curl命令访问第二题的web服务，看能否正常访问，如果能正常访问&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;&amp;nbsp; 则返回web server is running；如果不能正常访问，返回12状态码。&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;--------------------------------------------------------------------------------------&lt;/span&gt;&lt;br /&gt;&#xa;&lt;span style=&quot;font-size:16px;&quot;&gt;4.创建一个名为/root/foo.sh的脚本，让其提供下列特性：&lt;strong&gt;（15分）&lt;/strong&gt;&lt;/span&gt;&